import { Component, OnInit, OnDestroy } from '@angular/core';
import { HttpErrorResponse, HttpResponse } from '@angular/common/http';
import { Subscription } from 'rxjs';
import { JhiEventManager, JhiAlertService } from 'ng-jhipster';

import { IAppSettings } from 'app/shared/model/app-settings.model';
import { Principal } from 'app/core';
import { AppSettingsService } from './app-settings.service';

@Component({
    selector: 'jhi-app-settings',
    templateUrl: './app-settings.component.html'
})
export class AppSettingsComponent implements OnInit, OnDestroy {
    appSettings: IAppSettings[];
    currentAccount: any;
    eventSubscriber: Subscription;

    constructor(
        private appSettingsService: AppSettingsService,
        private jhiAlertService: JhiAlertService,
        private eventManager: JhiEventManager,
        private principal: Principal
    ) {}

    loadAll() {
        this.appSettingsService.query().subscribe(
            (res: HttpResponse<IAppSettings[]>) => {
                this.appSettings = res.body;
            },
            (res: HttpErrorResponse) => this.onError(res.message)
        );
    }

    ngOnInit() {
        this.loadAll();
        this.principal.identity().then(account => {
            this.currentAccount = account;
        });
        this.registerChangeInAppSettings();
    }

    ngOnDestroy() {
        this.eventManager.destroy(this.eventSubscriber);
    }

    trackId(index: number, item: IAppSettings) {
        return item.id;
    }

    registerChangeInAppSettings() {
        this.eventSubscriber = this.eventManager.subscribe('appSettingsListModification', response => this.loadAll());
    }

    private onError(errorMessage: string) {
        this.jhiAlertService.error(errorMessage, null, null);
    }
}
